import React, { ReactFragment } from "react";
import { Route, Routes} from "react-router-dom";

export const PrivateRoute = ( props ) => {
    return (
        <React.Fragment>
        <Routes>
        <Route exact={props.exact} path={props.path} element={props.component} />
        </Routes>
        </React.Fragment>
    );
}
